import React from "react";
import ReactDOM from "react-dom";
import {IoIosPerson} from "react-icons/io";
import {AiFillMail} from "react-icons/ai";
import {RiLockPasswordFill} from "react-icons/ri";

function SignInPage() {
    return (
        <div>
            <form>
                <center>
                    <div className="mb-3 mt-5">
                        <h2 className="jumbotron">Sign In</h2>
                        <table>
                            <tr><td><AiFillMail></AiFillMail></td><td><input type="surname" className="form-control" id="floatingInput" placeholder="Email" style={{margin: 10}}/></td></tr>
                            <tr><td><RiLockPasswordFill></RiLockPasswordFill></td><td><input type="password" className="form-control" id="floatingInput" placeholder="Password" style={{margin: 10}}/></td></tr>
                        </table>
                        <br></br>
                        <button type="submit" className="btn btn-success">Log In</button><br></br><br></br>
                        <p style={{color: "DarkGrey"}}>Not registered? Create an account</p>
                    </div>
                </center>
            </form>
        </div>
    );
}

export default SignInPage;
